import React from "react";
import { Nav,NavLink } from "react-bootstrap";
// import Welcome from "./bouton bienvenue/welcome";
import { Link } from "react-router-dom";

export default class Navbar extends React.Component{
    render(){
        return(
        <div id="page-top">
            <nav className="navbar navbar-expand-lg navbar-dark fixed-top" id="mainNav">
                    <div className="container">
                            <Link className="navbar-brand bord" to="#page-top"><img src="assets/img/logo_sansfond.png" alt="..."/></Link>
                            <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarResponsive" aria-controls="navbarResponsive" aria-expanded="false" aria-label="Toggle navigation">
                                Menu
                                <i className="fas fa-bars ms-1"></i>
                            </button>
                            <div className="collapse navbar-collapse" id="navbarResponsive">
                                <ul className="navbar-nav text-uppercase ms-auto py-4 py-lg-0">
                                    <li className="nav-item"><Link className="nav-link" to="#page-top">Home</Link></li>
                                    <li className="nav-item"><Link className="nav-link" to="#portfolio">Profils</Link></li>
                                    <li className="nav-item"><Link className="nav-link" to="#about">À propos</Link></li>
                                    <li className="nav-item"><Link className="nav-link" to="#team">Equipes</Link></li>
                                    <li className="nav-item"><Link className="nav-link" to="#contact">Contact</Link></li>
                                </ul>
                            </div>
                    </div>
             </nav>
             <header class="masthead">
            <div class="container">
                <div class="masthead-subheading">BIENVENUE À GNB</div>
                {/* <!-- <div class="masthead-heading text-uppercase"> BIENVENUE À GNB</div> --> */}
                <a class="btn btn-primary btn-xl text-uppercase" href="#services">En savoir plus</a>
            </div>
        </header>
             {/* <Welcome /> */}
        </div> 
            
        )
    }
}
